pany_name"],    verifyEmail: json["verify_email"],    adminApprove: json["admin_approve"],    email: json["email"],    password: json["password"],    phone: json["phone"],    brandLogo: json["brand_logo"],  );  Map<String, dynamic> toJson() => {    "selected_plan": selectedPlan?.toJson(),    "max_car": maxCar,    "years_in_business": yearsInBusiness,    "id_prove": idProve,    "account_creation_date": accountCreationDate,    "l_name": lName,    "business_license": businessLicense,    "verify_account": verifyAccount,    "verify_phone": verifyPhone,    "account_verify_date": accountVerifyDate,    "f_name": fName,    "brief_company": briefCompany,    "vendor_id": vendorId,    "company_name": companyName,    "verify_email": verifyEmail,    "admin_approve": adminApprove,    "email": email,    "password": password,    "phone" : phone,    "brand_logo": brandLogo,  };}class SelectedPlan {  final int? maxCar;  final String? price;  final String? planName;  SelectedPlan({    this.maxCar,    this.price,    this.planName,  });  factory SelectedPlan.fromJson(Map<String, dynamic> json) => SelectedPlan(    maxCar: json["max_car"],    price: json["price"],    planName: json["plan_name"],  );  Map<String, dynamic> toJson() => {    "max_car": maxCar,    "price": price,    "plan_name": planName,  };}